function Product(props) {
  const { items } = props;
  return (
    <div>
      <img src={props} alt={props}></img>
      <h4>{props}</h4>
      <div>${items.price}</div>
      <div>
        <button>add to cart</button>
      </div>
    </div>
  );
}
export default Product;
